import React, {useState, useEffect} from 'react';

const ViewOrder = () => {
  const [items, setItems] = useState({list : []});

  useEffect (() =>{

    fetch('http://localhost:8000/vieworder').then(
      response => response.json()
      ).then(data => {
        console.log(data);
        setItems({list : data})

    })}, [])
  return (
    <>
    {(items.list.map((item, index) => {

      return (
        <div key = {index}>
        <h3>{item.table} </h3>

        </div>
      )


      }))}
      </>

  );

}

export default ViewOrder;
